import React from 'react';
import './TitleEdit.css';

const TitleEdit = () => {
  return (
    <div className='t-edit'>
      <form className='t-editform'>
       <input type="text" 
           placeholder={'Enter new Title'}  
       />
       <button className='btn'>Submit</button>
      </form>
    </div>
  )
}

export default TitleEdit
